import styled from "styled-components";

const List = styled.ul`
  width: 430px;
  padding: 0;
`;

const Item = styled.li`
  width: 430px;
  padding: 0;
`;

const TopWrapper = styled.div``;

const NameWrapper = styled.div``;

const RatingWrapper = styled.div``;

const Avatar = styled.div`
width: 60px;
height: 60px;
border-radius: 60px;
background: #F2F4F7;
padding: 14px;
`;

const Name = styled.p``;

const Text = styled.p``;

export {
  Item,
  List,
  TopWrapper,
  NameWrapper,
  RatingWrapper,
  Avatar,
  Name,
  Text,
};
